import './App.css';
import './bounce.css';
import React from 'react';
import Typewriter from "typewriter-effect";
import $ from 'jquery'

function App() {
window.addEventListener('scroll', () =>{
  const scrolled = window.scrollY;
  var aTop = $('#aboutMe').height();
  if(scrolled >= aTop){
    App2()
    
  }

});




  return (
  <>
  

  <div id='intro'>
    <div id='name'>
      <div className="bouncing-text">
        <div className="b">h</div>
        <div className="o">i</div>
        <div className="u">,</div>
      </div>
      <div className="bouncing-text">
        <div className="b">i</div>
        <div className="o">'</div>
        <div className="u">m</div>
        <div className="n">N</div>
        <div className="c">a</div>
        <div className="e">v</div>
        <div className="f">i</div>
        <div className="g">d</div>
      </div>
    </div>
  </div>
 
  
  <div id='aboutMe'>
      
   
    
  </div>
  </>
  );
  
}

function App2() {
  return (
    <div className="App">
      <Typewriter
  
       onInit={(typewriter)=> {
  
       typewriter
        
       .typeString("GeeksForGeeks")
         
       .pauseFor(1000)
       .deleteAll()
       .typeString("Welcomes You")
       .start();
       }}
       />
    </div>
  );
}

